import { keys } from './keys';
describe('Test for keys', function () {
    it('should return keys of array', function () {
        expect(keys(['x', 'y', 'z'])).toEqual(['0', '1', '2']);
    });
    it('should return keys of object', function () {
        expect(keys({ a: 'x', b: 'y', c: 'z' })).toEqual(['a', 'b', 'c']);
    });
});
